import axios from 'axios';
import config from './config'
import qs from 'qs';

axios.defaults.BaseURL = config.apiUrl;

export const postLoginToken = obj => {
  return axios({
    method: 'post',
    url: '/login',
    headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
    data: qs.stringify(obj)
  });
}
